const updateContent = (route) => {
  switch (route) {
    case '': case '/': case 'home':
      tempRender('home');
      break
    case '/login':
      triggerLoginFlow();
      break
    case '/login/return': case '/login/return/':
      triggerLoginReturnFlow();
      break
    case '/sell':
      initSellFlow();
      break
    case '/sell/inventory':
      initListModInventory();
      break
    case '/buy':
      tempRender('buy');
      break
    case '/error':
      renderError();
      break

    case '/admin':
      initAdmin();
      break
    case '/admin/payments-pending':
      initAdminPendingPayments();
      break
    case '/admin/payments-complete':
      initAdminCompletePayments();
      break
    case '/admin/journal':
      initAdminJournal();
      break

    default:
      render404();
  }
};

const handleRouteChange = () => {
  console.log('handleRouteChange');
  let route = window.location.pathname;
  if (route[0] === '#') route = route.substring(1);
  console.log('handleRouteChange', route);
  updateContent(route);
};
